service: abc-bank-h5-api

provider:
  name: tencent
  runtime: Nodejs18.13
  region: ap-guangzhou
  credentials: ~/.tencentcloud/credentials

functions:
  api:
    handler: index.main_handler
    memorySize: 512
    timeout: 10
    environment:
      # 数据库配置
      POSTGRES_HOST: ${env:POSTGRES_HOST}
      POSTGRES_PORT: ${env:POSTGRES_PORT}
      POSTGRES_USER: ${env:POSTGRES_USER}
      POSTGRES_PASSWORD: ${env:POSTGRES_PASSWORD}
      POSTGRES_DB: ${env:POSTGRES_DB}

      # Redis配置
      REDIS_HOST: ${env:REDIS_HOST}
      REDIS_PORT: ${env:REDIS_PORT}
      REDIS_PASSWORD: ${env:REDIS_PASSWORD}

      # JWT密钥
      JWT_SECRET: ${env:JWT_SECRET}

      # 加密密钥（32字节）
      ENCRYPT_KEY: ${env:ENCRYPT_KEY}

      # 腾讯云短信服务（待审核通过后取消注释并配置）
      # TENCENT_SECRET_ID: ${env:TENCENT_SECRET_ID}
      # TENCENT_SECRET_KEY: ${env:TENCENT_SECRET_KEY}
      # TENCENT_SMS_APP_ID: ${env:TENCENT_SMS_APP_ID}
      # TENCENT_SMS_SIGN_NAME: ${env:TENCENT_SMS_SIGN_NAME}
      # TENCENT_SMS_TEMPLATE_ID: ${env:TENCENT_SMS_TEMPLATE_ID}

    events:
      - apigw:
          name: abc-h5-api
          parameters:
            protocols:
              - https
            environment: release
            endpoints:
              - path: /
                method: ANY
              - path: /{proxy+}
                method: ANY

